import React from 'react'

const Submit = () => {
  return (
    <div className='Submit'>
        <div className="btns">
            <input className='second-btn mobile-btn' type="button" value="PUBLISH" />
            <input type="button" value="CANCEL" />
            <input className='second-btn lab-btn' type="button" value="Submit" />
        </div>
    </div>
  )
}

export default Submit
